import React from 'react';
import s from "./Transport.module.css";
import Category from "../Category/Category";
import Subcategories from "../Subcategories/Subcategories";

import archirectImg from './../architect.svg';
import autoImg from './../auto.svg';
import motoImg from './../moto.svg';
import householdImg from './../household.svg';

import {
  TRANSPORT, IMMOVABLES, HOUSEHOLD,
  CARS, MOTO,
} from "../../redux/UrlReducer";

const Transport = (props) => {

  const immovables = props.catList[0];
  const cars = props.catList[1];
  const moto = props.catList[2];
  const household = props.catList[3];

  debugger;

  return (
      <div>
        <h3>Выберите категорию</h3>
        <div className={s.content}>
          <div className={s.categories}>
            <Category nameCategory={IMMOVABLES.name} imgPath={archirectImg} urlCategory={IMMOVABLES.url}/>
            <Subcategories nameSubCat={CARS.name} imgPath={autoImg} urlSubcategory={CARS.url}/>
            <Subcategories nameSubCat={MOTO.name} imgPath={motoImg} urlSubcategory={MOTO.url}/>
            <Category nameCategory={HOUSEHOLD.name} imgPath={householdImg} urlCategory={HOUSEHOLD.url}/>
          </div>
        </div>
      </div>
  );
};

export default Transport;
